BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `UniqueCalls` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`Callsign`	VARCHAR ( 15 ),
	`Country`	VARCHAR ( 39 ),
	`QSL`	VARCHAR ( 6 ),
	`DXCC`	VARCHAR ( 3 ),
	`ARRLPrefix`	VARCHAR ( 5 ),
	`Prefix`	VARCHAR ( 5 ),
	`Continent`	VARCHAR ( 2 ),
	`CQZone`	INTEGER,
	`ITUZone`	INTEGER,
	`Latitude`	VARCHAR ( 8 ),
	`Longitude`	VARCHAR ( 9 ),
	`Enable`	VARCHAR ( 1 ),
	`EndDate`	VARCHAR ( 19 ),
	`StartDate`	VARCHAR ( 19 )
);
COMMIT;
